import React from 'react';
import styles from './Publication.module.css';

const Publication = () => {
  return (
    <div className={style.main}>
      <img
        className={style.image}
        src="http://www.wpkixx.com/html/winku-dark/images/resources/admin2.jpg"
        alt="my image"
      />
      <input placeholder="test" write something />
    </div>
  );
};

export default Publication;
